#!/usr/bin/python3
import sys
from collections import defaultdict, deque
from typing import List,Dict


# dfs 超时
# 需要使用bfs
class Solution:

    def maxProbability(self, n: int, edges: List[List[int]], succProb: List[float], start: int, end: int) -> float:
        if start == end:
            return 1.0
        result = 0
        edges_map = defaultdict(list)
        for i,edge in enumerate(edges):
            edges_map[edge[0]].append([edge[1], succProb[i]])
            edges_map[edge[1]].append([edge[0], succProb[i]])
        points = [0 for _ in range(n)]
        bfs_queue = deque([start])
        points[start] = 1.0


        while bfs_queue:
            vertex = bfs_queue.popleft()
            for item in edges_map[vertex]:
                probability = points[vertex] * item[1]
                if probability > points[item[0]]:
                    points[item[0]] = probability
                    if item[0] == end:
                        result = probability
                        continue
                    bfs_queue.append(item[0])
        return result


    dic = {}
    points = []
    result = 0

    def maxProbability_helper(self,start: int, end: int, probability:float):
        if probability <= self.points[start] or probability < 0.00001:
            return
        self.points[start] = probability
        if start == end:
            if probability > self.result:
                self.result = probability
            return
        if start in self.dic:
            for path in self.dic[start]:
                self.maxProbability_helper(path[0],end, probability * path[1])

    def maxProbability_dfs(self, n: int, edges: List[List[int]], succProb: List[float], start: int, end: int) -> float:
        self.points = [0 for _ in range(n)]
        self.dic = defaultdict(list)
        for i in range(len(edges)):
            self.dic[edges[i][0]].append([edges[i][1], succProb[i]])
            self.dic[edges[i][1]].append([edges[i][0], succProb[i]])
        self.result = 0
        self.maxProbability_helper(start, end, 1.0)
        return self.result


